val input = ""

fun main() {
    run {
        val sample = "dabAcCaCBAcCcaDA"
        val expected = "dabCBAcaDA".length
        val actual = Day05(sample).react()
        if (expected != actual) {
            throw Error("react() test failed: expected $expected, got $actual")
        }

        val expected2 = 10774
        val actual2 = Day05(input).react()
        if (expected2 != actual2) {
            throw Error("react() test failed: expected $expected2, got $actual2")
        }
    }

    run {
        val sample = "dabAcCaCBAcCcaDA"
        val expected = "daDA".length
        val actual = Day05(sample).fullyReact()
        if (expected != actual) {
            throw Error("fullyReact() test failed: expected $expected, got $actual")
        }
        
        val expected2 = 5122
        val actual2 = Day05(input).fullyReact()
        if (expected2 != actual2) {
            throw Error("fullyReact() test failed: expected $expected2, got $actual2")
        }
    }

    println("All tests passed!")
}